const Header = () => {

    return (
        <div className="header">
        <div className="logo">코짖새</div>
        <nav>
            <ul>
                <li>투자지표</li>
                <li>자유토론방</li>
            </ul>
            <ul>
                <li>로그인</li>
                <li>회원가입</li>
            </ul>
        </nav>
        </div>

    )

};

export default Header;
